import React, { Component } from 'react'
import img from "../images/avatar.jpeg";
import "../style/home.css"

class home extends Component {
    downloadCV = (e) =>{
        alert("asdasdsa");
    }
    render() {
        return (
                <div className="home">
                    <div className="img">
                            <img src={img}></img>
                        </div>
                        <div className="home-info">
                            <h1>Ömer AKKOCA</h1>
                            <p>Yazılım Mühendisi</p>
                            <p>Web Geliştirici ve Tasarımcı</p>
                            <button onClick={this.downloadCV}>CV İndir</button>
                    </div>
                </div>
        )
    }
}

export default home;
